%[text] # Visualization of MRI Reconstruction
%[text] Visualizing MRI reconstruction results is crucial for analyzing and interpreting the data. Various visualization techniques can be employed to view and understand the reconstructed images effectively.
%[text] **Medical volume datastore** 
%[text] The [`medicalVolume`](https://www.mathworks.com/help/medical-imaging/ref/medicalvolume.html) function in MATLAB is used to create a medical volume object from image data. This object encapsulates the voxel data and associated metadata, such as the volume's geometry and patient coordinate system

R = medicalref3d(size(rss_CSimage));
medVolCSReconImage =medicalVolume(rss_CSimage,R);
medVolCSReconImage.VolumeGeometry.PatientCoordinateSystem ="LPS+";
voxInfo =medVolCSReconImage.Voxels;
min_val = min(voxInfo(:));
max_val = max(voxInfo(:));
normalized_data = (voxInfo(:) - min_val) / (max_val - min_val);

data =reshape(normalized_data,[256 256 18]);
newMedVol= medicalVolume(data,medVolCSReconImage.VolumeGeometry);
%%
%[text] ## Visualization Methods
%[text] #### Slice View:
%[text] Displays individual slices of the 3D reconstructed image, allowing detailed examination of each slice.
sliceViewer(newMedVol,Parent=figure)
%%
%[text] ### Volume Rendering
%[text] Provides a 3D visualization of the reconstructed image using cinematic rendering, enhancing the depth and detail of the image.
c =bone(20);
volshow(newMedVol,RenderingStyle="CinematicRendering",Colormap=c) %[output:80fc3f16]
%%
%[text] ### Montage View
%[text] Creates a montage of slices from the 3D reconstructed image, offering a comprehensive overview of the entire volume.
montage(newMedVol) %[output:7d5612f0]
