%[text] ### Phase Encoding Direction Undersampling
%[text] 
%[text] In magnetic resonance imaging (MRI), k-space is a mathematical space where the raw data from the MRI scanner is stored before being transformed into an image. The k-space data is typically acquired in two dimensions: frequency encoding and phase encoding directions.
%[text] Phase encoding direction undersampling refers to selectively acquiring fewer data points in the phase encoding direction of k-space. This technique is used to reduce scan time while attempting to maintain image quality. By undersampling, we can speed up the imaging process, which is particularly useful in dynamic imaging or when patient movement is a concern.
%[text] 
%[text] Description ***function samplingMask = generate1DVariableDensityMask(N, density)***
%[text] This function generates a one-dimensional variable density undersampling mask for the phase encoding direction in MRI. The mask is designed to sample k-space data with varying density, focusing more on the central regions where the most significant information for image reconstruction is located.
%[text] Parameters
%[text] - N: Specifies the length of the k-space data in the phase encoding direction.
%[text] - density: Controls the shape of the density profile, influencing how densely different regions of k-space are sampled \
%[text] #### Mask option 1
function samplingMask = generate1DVariableDensityMask(N, density) % Generate a 1D variable density undersampling mask
    % N: Length of the k-space data in the phase encoding direction
    % density: Parameter controlling the density profile

    % Create a polynomial density profile
    x = linspace(-1, 1, N);
    densityProfile = (1 - abs(x)).^density;

    % Generate mask based on density profile
    randomValues = rand(1, N);
    samplingMask = randomValues < densityProfile;
end
%%
%[text] **Mask option 2**


function samplingMask = generateVariableDensityCartesianMask(m, n, density)
    % Generate a 2D variable density Cartesian undersampling mask
    % m: Number of rows in the k-space data
    % n: Number of columns in the k-space data
    % density: Parameter controlling the density profile

    % Create a polynomial density profile
    [X, Y] = meshgrid(linspace(-1, 1, n), linspace(-1, 1, m));
    densityProfile = (1 - abs(X)).^density .* (1 - abs(Y)).^density;

    % Generate mask based on density profile
    randomValues = rand(m, n);
    samplingMask = randomValues < densityProfile;
end



